import { Grid, List } from '@mui/material';
import React, { useEffect, useState } from 'react';
import './styles/Search.module.css';

const Search = () => {
  return (
    <div className="">
      <div>
        <input className="" type="text" placeholder="Search" alt="Searching" />
      </div>
      <img
        src={`https://picsum.photos/${Math.round(
          Math.random() * (700 - 600) + 500
        )}`}
        className="img"
      />
    </div>
  );
};

export default Search;
